    private String plusOne(int[] digits) {
        cn.idear.algorithm.plus_one.Solution solution = new cn.idear.algorithm.plus_one.Solution();
        int[] rst = solution.plusOne(digits);
        String str = "";
        for(int i = 0; i < rst.length; i++)
            str += rst[i];
        return str;
    }

